%[text] # **A Question on the Ideal Gas Law, Data Analysis, and Footballs**
%[text] The relationship among pressure, volume, and temperature of a gas such as air are frequently modeled using the ideal gas law:
%[text]  where $P$ is the pressure, $ V$ is the volume, $n $ is amount of substance in moles, $R$ is the universal gas constant (using SI units it has a value of 8.314 Joules per mole per degree Kelvin), and $T$ is the temperature.  It's important in this model that both pressure and temperature are measured in absolute scales so that zero on the scale corresponds to the theoretically lowest value possible to attain.
%[text] Figure 1.  A football with a pressure gauge in it. 
%[text] The Ideal Gas Law became a common topic of discussion when the New England Patriots football team was accused of using underinflated footballs in the AFC Championship game against the Indianapolis Colts in January 2015.  
%[text] **Question 1**
%[text] The minumum gauge pressure according to the rules of the National Football League is 12.5 pounds per square inch.  On a day with normal atmospheric pressure near sea level (0.1013 MegaPascals), that corresponds to an absolute pressure of 0.1875 MegaPascals of pressure in the football.  Assume the footballs were checked and confirmed to be 12.5psi in a locker room at 19.4 degrees Celcius (which is 292.6 Kelvin).  The temperature on the playing field that day was 10 degrees Celcius  (which is 283.15 Kelvin).  What would the Ideal Gas Law predict as the pressure of the balls assuming they were at a uniform temperature equal to that on the playing field and assuming the volume of the balls was constant?
% The Ideal Gas Law states PV=nRT
% Therefore, if volume is constant P/T should be constant
% In the locker room 
PTratio=0.1875/292.6; % MegaPascals per Kelvin
Tgame=283.15; % deg Kelvin
% So pressure on the field would be
Pgame=PTratio*Tgame %[output:617707f1]
%%
%[text] **Question 2**
%[text] The pressure you should have found in Question 1 is 0.1814 MegaPascals.  This converts to a gauge pressure of 11.6 psi.  During halftime of the game, two NFL referees named Blakeman and Prioleau measured the pressure in 11 footballs used by the Patriots.  The measurements they made are
Blakeman=[11.5 10.85 11.15 10.70 11.10 11.60 11.85 11.10 10.95 10.50 10.90];
Prioleau=[11.80 11.20 11.50 11.00 11.45 11.95 12.30 11.55 11.35 10.90 11.35];
plot(1:11,Blakeman,'bo') %[output:8e9f975d]
hold on %[output:8e9f975d]
plot(1:11,Prioleau,'ro') %[output:8e9f975d]
plot([1 11],[11.6 11.6],'r--') %[output:8e9f975d]
legend('Blakeman', 'Prioleau') %[output:8e9f975d]
text(9,11.6,'Ideal Gas Law') %[output:8e9f975d]
%[text] What are the mean and standard deviation of the whole set of measurements?  How many standard deviations was the mean away from the value predicted by the Ideal Gas Law?
% The descriptive statistics requested are
mean_meas=mean([Blakeman Prioleau]) %[output:571c7a4a]
std_meas=std([Blakeman Prioleau]) %[output:8a2211d6]
(11.6-mean_meas)/std_meas %[output:1fe22571]
%%
%[text] **Question 3**
%[text] So the balls on that day, according to the whole data set, were on average about 0.3 psi too soft which is about 0.7 standard deviations.  But perhaps it'as not valid to treat these 22 measurements as independent data elements.  They were really just measurements of 11 balls with two different gauges used on each ball.  And the gages used by the referees, given a casual inspection, appear to be markedly different in their results.  For every single one of the 11 balls measured, Blakeman's gauge gave a lower reading than Prioleau's gauge.  That doesn't seem like a difference that would happen at random.  Statistics gives us the opportunity to check our intuitions on this point. 
%[text]    According to a paired sample Students t test, what is the chance of deviations in the measurements from the two gauges coming out in a pattern such as observed here assuming they were random and Normally distributed?
% The ttest with paired samples is
[h p]=ttest(Blakeman, Prioleau) %[output:40bf7668] %[output:950ad015]
%%
%[text] **Question 4**
%[text] A statsitical hypothesis test has shown us that the gages used by the referees were surely giving different readings.  The probability that the two gauges were giving readings from the same sampling distribution is extremely small.  So the suggestion that the gauges are different is substantiated.   
%[text] It is not known with certainty which gauge was used to check the Patriots balls before the game started.  The official "Wells report" made the assumption that Blakeman's gauge was used before the game.   Let's try the alternative analysis that it was Prioleau's gage that was used before the game.
%[text]    According to a Students t test, what is the chance of a set of 11 measurements coming out from a population of balls with a mean equal to the prediction of 11.6 psi based on the Ideal Gas Law?  NOTE:  This requires the assumption that variations in the observed measurements were random and Normally distributed?
% The ttest for a predicted mean is
[h p]=ttest([Prioleau],11.6) %[output:3ab13091] %[output:91dd1740]
%%
%[text] A statistical hypothesis test has shown us that if Prioleau's gage is the basis for evaluation, the chance of deviations such as observed that day is 38%.  Based on this analysis, it is more likely than not that the Patriots balls were softer than predicted by the Ideal Gas Law.  However, about one time out of three, data like this would be observed just due to random sampling.  It is not unlikely that the difference was due to random chance.
%[text] **Question 5**
%[text] Another issue of randomness came into the considerations of this data.  The Patriots balls exhibited a lot of variation in pressure.  Perhaps that variability was due to the tampering instead of the fact that the Patriots had   The Colts balls were said to be more consistent than the Patriots balls according to the official "Wells report".  At halftime, four balls from the Colts were measured by each referee.  According to the records, the data were:
% The Colts football pressures
Blakeman_Colts=[12.70 12.75 12.50 12.55];
Prioleau_Colts=[12.35 12.30 12.95 12.15];
figure(3) %[output:62f8ec1f]
plot(1:4,Blakeman_Colts,'bo') %[output:62f8ec1f]
hold on %[output:62f8ec1f]
plot(1:4,Prioleau_Colts,'ro') %[output:62f8ec1f]
legend('Blakeman', 'Prioleau') %[output:62f8ec1f]
%[text] Based on this data, it was assumed that Blakeman and Prioleau must have swapped gauges.  Previosly, when measuring the Patriot's balls, Prioleau's readings were higher in each case.  Now, when measuring the Colt's balls, Prioleau's readings were lower in each case.except for ball number 3.  The Wells report assumed that the two referees switched gauges between the two measurements and also there was a transcription error for ball \#3.  The report proceeded as if the data had been  
% The Colts football pressures
% Swap the gauges
Gauge_no_1_Colts=Prioleau_Colts;
Gauge_no_2_Colts=Blakeman_Colts;
% Swap reading for ball #3
Gauge_no_1_Colts(3)=Blakeman_Colts(3);
Gauge_no_2_Colts(3)=Prioleau_Colts(3);
figure(4) %[output:19d46ac2]
plot(1:4,Gauge_no_1_Colts,'bo') %[output:19d46ac2]
hold on %[output:19d46ac2]
plot(1:4,Gauge_no_2_Colts,'ro') %[output:19d46ac2]
legend('Gauge number 1', 'Gauge Number 2') %[output:19d46ac2]
%[text] Choose a hypothesis test and run that test to determine if the variability is different comparing the Patriots 11 balls as measured by Prioleau and the 4 Colts balls which were assumed to be measured with the same gauge (\#2).
[h,p]=vartest2(Prioleau, Gauge_no_2_Colts) %[output:07ffa39e] %[output:1d42d790]
%[text] In question 5, we see that it is not very likely (~16% chance) that the apparently greater variability in the Patriots footballs was due to random sampling only.   But an important difference in those footballs also was the different conditions they experienced.  The Patriots had posession in that game for 37:49 whereas the Colts had possession for 22:11.  The Patriots game balls were used a lot more.  Does that affect the pressure?     It was also raining.  If a football is soaked with water and then used extensively, what is the effect on the leather?  Does that impact the assumption of the Ideal Gas Law that a football has a constant volume?  
%[text] **Question 6**
%[text] A) Describe an experiment that could resolve whether wetness of a football sustained for one hour would affect the pressure in the ball.  
%[text] B) Describe an experiment that could resolve whether typical use of a football for one hour would affect the pressure in the ball.
%[text] C) Describe an experiment that could resolve whether wetness of a football combined with typical use of a football for one hour would affect the pressure in the ball.
%[text] D) Do you expect that the effect of the conditions in experiment C can be predicted by adding together the effects measured in experiments A and B?  If not, in what direction is the difference due to the interaction between wetness and use?  
%%
%[text] **Question 7**
%[text] Right after the controversy of the Deflategate episode, the National Football League collected data on football pressures before, after, and at halftime of games throughout the 2016 season.  The goal of this data collection was to monitor teams for compliance and detect any evidence of tampering.  An additional use of the data would have been to determine what effects temperature and wetness and use have on ball inflation pressures.  The NFL reported to the public that there was no evidence of tampering with footballs in the 2016 season, but did not release the raw data.  Hypothetically, if these data were available, what graphical presentation of the data would help an audience to understand whether the Patriots footballs in the AFC championship game look similar to balls?  What axes would you use on your graph?  What data series would you plot?  
%%
%[text] We don't currently have access to the before and after pressure data for the 2016 season.  To try to generate some similar data, we at least know the temperatures of all the 10,307 NFL games played outdoors since 1960.  If we assume that balls remain at constant volume despite use, that they were filled to 12.5 psi at the start of the game, and that they came to thermal equilibrium before assessing the pressure, the plot generated by the code below presents the pressures measured on game days versus the time of year they were played.
load temp_all_games %[output:3d79aeb0]
load game_days
P_ideal_gas = (14.7+12.5)*(T_all_games+459.67)/(70+459.67)-14.7; % pressure starting at 12.5
figure(5)
xlabel('Time of Year')
ylabel('Predicted Ball Pressure')
plot(game_day, P_ideal_gas,'bo')
ax = gca;
ax.XTickMode = 'manual';
ax.XTick = [1 31 62 92 123 154];
ax.XTickLabel = {'Sep 1', 'Oct 1', 'Nov 1', 'Dec 1', 'Jan 1', 'Feb 1'};
set(gca,'fontsize',12);
%[text] **Question 8**
%[text] Add the Patriots football pressures as measured by both referees to the plot.  Use different symbols.  Recall that the AFC championship game was played on Jan 18.
AFC_game_day=123+18;
hold on
plot(AFC_game_day, Prioleau,'rx')
plot(AFC_game_day, Blakeman,'mo')

